B.GD=new A.b8(B.cx,["Go Ma\xe7 Saati","Zaman Sistemi","Japon Byoyomi","Ana S\xfcre + Japon Byoyomi Hakk\u0131 x S\xfcre","Kanada Byoyomi","Ana S\xfcre + S\xfcre / Hamle Say\u0131s\u0131","Basit Zaman","Ana S\xfcre (Ek s\xfcre yok)","Farkl\u0131 Ayar Kullan","Siyah","Beyaz","Ana S\xfcre","Byoyomi S\xfcresi","Hamle Say\u0131s\u0131 (Kanada Byoyomi)","Japon Byoyomi Hakk\u0131 (Adet)","Ba\u015flat","S\xfcre Se\xe7","Se\xe7","\u0130ptal","Tamam","Hamle","Kazand\u0131!","Ana Sayfaya D\xf6n","Hakk\u0131nda","Yaz\u0131l\u0131m:","Tasar\u0131m:","Destekleri i\xe7in te\u015fekk\xfcrler:","Go Match Timer Nas\u0131l Kullan\u0131l\u0131r?","\ud83c\udfaf Ama\xe7","Go Match Timer, Go / Baduk / Weiqi turnuvalar\u0131nda kullan\u0131lan resmi zaman sistemlerini do\u011fru ve sade bir \u015fekilde uygulamak i\xe7in tasarlanm\u0131\u015ft\u0131r.","\ud83d\udd79 Anasayfa","Japon Byoyomi, Kanada Byoyomi veya Basit Zaman se\xe7ilir.","Dil butonu ile aray\xfcz dili de\u011fi\u015ftirilebilir.","Bilgi (?) butonu uygulama hakk\u0131nda detay verir.","\u23f1 Zaman Sistemleri","Basit Zaman: S\xfcre bitti\u011finde oyun sona erer.","Japon Byoyomi: Ana s\xfcre bittikten sonra her hak i\xe7in sabit s\xfcre verilir.","Kanada Byoyomi: Belirli say\u0131da hamle, sabit s\xfcre i\xe7inde oynan\u0131r.","\u25b6\ufe0f Oyun Ekran\u0131","Ekran\u0131n tamam\u0131na dokunmak hamleyi kar\u015f\u0131 tarafa ge\xe7irir.","Orta \xe7ubukta ba\u015flat / durdur ve ses kontrol\xfc bulunur.","\xdcst ve alt oyuncu alanlar\u0131 otomatik d\xf6ner.","\ud83d\udd0a Ses Uyar\u0131lar\u0131","Son 10 saniyede uyar\u0131 sesi \xe7alar.","Ses butonu ile a\xe7\u0131l\u0131p kapat\u0131labilir.","\ud83c\udfc1 Oyun Sonu","S\xfcre veya haklar bitti\u011finde kazanan otomatik belirlenir.","Ana sayfaya tek tu\u015fla d\xf6n\xfclebilir.","Go Match Timer turnuva masas\u0131nda h\u0131zl\u0131, sade ve dikkat da\u011f\u0131tmayan bir kullan\u0131m sunmak i\xe7in tasarlanm\u0131\u015ft\u0131r.","\u26a0\ufe0f Sorumluluk Reddi","Bu uygulama yaln\u0131zca zaman takibini kolayla\u015ft\u0131rmak amac\u0131yla geli\u015ftirilmi\u015ftir. Uygulaman\u0131n kullan\u0131m\u0131 s\u0131ras\u0131nda olu\u015fabilecek zamanlama hatalar\u0131, oyun sonu\xe7lar\u0131, turnuva kararlar\u0131 veya anla\u015fmazl\u0131klardan geli\u015ftirici sorumlu de\u011fildir.","Resm\xee turnuvalarda kullan\u0131lmadan \xf6nce organizat\xf6r onay\u0131 al\u0131nmas\u0131 \xf6nerilir. Zaman ayarlar\u0131n\u0131n do\u011frulu\u011funu kontrol etmek ve uygulamay\u0131 uygun \u015fekilde kullanmak tamamen kullan\u0131c\u0131n\u0131n sorumlulu\u011fundad\u0131r."],t.l)
